import React, { Component } from 'react'
import Card from './Card';

export default class Cards extends Component {

  getStyle = () => {
    return {
        display: 'grid',
        gridTemplateColumns: 'repeat(3, 1fr)',
        gridColumnGap: '1em',
    }
}

  render() {
    return this.props.data.map((x) => (
        <div style={this.getStyle()}><Card card={x} /></div>
    ));
  }
}
